import React from 'react';

function ScanResult({ result }) {
  const { parsed_email, ai_analysis } = result;

  const getRiskClass = (score) => {
    if (score < 30) return 'risk-low';
    if (score < 70) return 'risk-medium';
    return 'risk-high';
  };

  const getRiskLevel = (score) => {
    if (score < 30) return 'Low Risk';
    if (score < 70) return 'Medium Risk';
    return 'High Risk';
  };

  return (
    <div className="scan-result">
      <h2>Scan Results</h2>

      <div className={`risk-score ${getRiskClass(ai_analysis.score)}`}>
        Risk Score: {ai_analysis.score}/100 - {getRiskLevel(ai_analysis.score)}
      </div>

      <div className="email-field">
        <label>AI Summary:</label>
        <p>{ai_analysis.summary}</p>
      </div>

      <h3>Email Details</h3>
      <div className="email-field">
        <label>From:</label>
        <p>{parsed_email.sender}</p>
      </div>

      <div className="email-field">
        <label>Subject:</label>
        <p>{parsed_email.subject}</p>
      </div>

      <div className="email-field">
        <label>Body:</label>
        <p style={{whiteSpace: 'pre-wrap'}}>{parsed_email.body}</p>
      </div>

      {parsed_email.urls.length > 0 && (
        <div className="email-field">
          <label>URLs Found:</label>
          <ul>
            {parsed_email.urls.map((url, index) => (
              <li key={index}>{url}</li>
            ))}
          </ul>
        </div>
      )}

      {parsed_email.attachments.length > 0 && (
        <div className="email-field">
          <label>Attachments:</label>
          <ul>
            {parsed_email.attachments.map((att, index) => (
              <li key={index}>{att.filename} ({att.content_type})</li>
            ))}
          </ul>
        </div>
      )}
    </div>
  );
}

export default ScanResult;
